import React from "react";
import { Link, useLocation, useNavigate } from "react-router-dom";
import logo from "../assets/quizapp_logo.png";
import icon from "../assets/person-icon-1.png";
import "../styles/HomeNavbar.css";

const HomeNavbar = ({ isLogin, setIsLogin }) => {
    const location = useLocation();
    const navigate = useNavigate();

    const handleLogout = () => {
        localStorage.removeItem("isLogin");
        localStorage.removeItem("token"); // if you're storing a token
        setIsLogin(false);
        navigate("/login");
    };

    const isLoginPage = location.pathname === "/login";
    const isSignupPage = location.pathname === "/signup";

    return (
        <nav className="navbar bg-dark">
            <div className="logo">
                <Link to="/">
                    <img src={logo} alt="quiz-app-logo" />
                </Link>
            </div>
            <div className="nav-right">
                <ul className="nav-links">
                    {!isLogin && !isLoginPage && (
                        <li><Link to="/login" className="bordered-link">Login</Link></li>
                    )}
                    {!isLogin && !isSignupPage && (
                        <li><Link to="/signup" className="bordered-link">Sign Up</Link></li>
                    )}
                    {isLogin && (
                        <>
                            <li><Link to="/profile" className="bordered-link">Profile</Link></li>
                            <li>
                                <button onClick={handleLogout} className="bordered-link btn btn-link text-white">
                                    Logout
                                </button>
                            </li>
                        </>
                    )}
                </ul>
                <div className="icon">
                    <Link to="/">
                        <img src={icon} alt="quiz-app-logo" />
                    </Link>
                </div>
            </div>
        </nav>
    );
};

export default HomeNavbar;
